import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import "./Nav.css";
import Dropdown from "../components/Dropdown/Dropdown";
import Axios from "axios";

class Nav extends Component {
  constructor(props) {
    super(props);
    this.state = {
      urllist: []
    };
  }

  fetchUrlsBasedonCatId = catId => {
    Axios.post("/api/urls/createUrl/${catId}").then(response => {
      console.log(response);
    });
  };

  fetchAllUrls = () => {
    Axios.post("/");
  };
  render() {
    const {
      match: { params }
    } = this.props;

    componentDidMount = () => {
      //api call with cat id
      fetchUrlsBasedonCatId(params.catid);
    };

    return (
      <form className="form">
        <div>
          <h1>List of URLs</h1>
        </div>
        <div>
          <Dropdown
            fetchurls={true}
            fetchUrlsBasedonCatId={fetchUrlsBasedonCatId}
            categoryId={params.catId}
          />
        </div>
      </form>
    );
  }
}
export default withRouter(Nav);
